import axios from 'axios';
import UserProfile from './user';

const baseURL = process.env.REACT_APP_API_URL;
const USER_ID = 123;

const axiosClient = axios.create({
  baseURL,
  headers: {
    'x-user-id': UserProfile,
  },
});

export default axiosClient;
